const A=[{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"1349",title:"1349",uid:968},biography:'<p class="docData;DOCY;v5;1905;">The year the plague raged and ended Norway’s golden age – 1349 not only teach us about history. The Black Metal outfit, with Satyricon drummer Frost, return to the Holy Ground with their latest record “The Wolf &amp; The King” to send billowing clouds of darkness over Wacken. Beware, it’s&nbsp;going&nbsp;to&nbsp;get&nbsp;cold.</p>',detailLink:"/de/programm/bands/band/1349/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=TH5Zf7qmUPM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"1349_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/1349_25.jpg",title:"",type:2,uid:30716}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3631,uri:"http://legion1349.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3632,uri:"https://www.facebook.com/1349official/"},{socialnetwork:{title:"Instagram",uid:5},uid:3633,uri:"https://www.instagram.com/1349official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"50xbiJGnTy1tSBZ9EFKnT",subtitle:"",thumbnail:"/fileadmin/_processed_/a/0/csm_1349_25_494e1b960b.jpg",uid:1298},{artist:{country:[{nameLocalized:"Belgien",shortNameDe:"Belgien",shortNameEn:"Belgium",uid:20}],events:[],pathSegment:"amenra",title:"Amenra",uid:970},biography:"<p>Ritual, remembrance and hard-won rebirth have always been at the heart of Amenra’s colossal, soul-purging approach. Centred around frontman Colin H. Van Eeckhout, but marked out by a transcendent unity of purpose, their albums have acted as totemic, personal marker points, a means to process individual grief as a shared, cathartic experience. Their live shows are acts of incendiary, communal exorcism that reach a cusp of sublime, out-of-body experience. A closely knit collective, they transport you to a febrile state where confrontation of pain, transformation and true healing can occur.</p>",detailLink:"/de/programm/bands/band/amenra/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=CD7bxyzFbC4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"amenra25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/amenra25.jpg",title:"",type:2,uid:32214}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3648,uri:"https://amenra-official.tumblr.com/?fbclid=IwY2xjawGz4GtleHRuA2FlbQIxMAABHShyhiYLZ0IInxvkpUDwAmmtRsD903-ogUcu1c0j_V5_EhW9xXz22ROq4w_aem_rSofaNLimKkevqmPL1TYZg"},{socialnetwork:{title:"Facebook",uid:1},uid:3649,uri:"https://www.facebook.com/churchofra/"},{socialnetwork:{title:"Instagram",uid:5},uid:3650,uri:"https://www.instagram.com/amenra_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0N1jE1EIrhZjvQSfuLupUu",subtitle:"",thumbnail:"/fileadmin/_processed_/d/4/csm_amenra25_97189902a6.jpg",uid:1303},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"angel-witch",title:"Angel Witch",uid:405},biography:"<p>Attention – it’s legend-alert! Who is ready for THE festival song living in your head rent-free in 2025?<br /> Once Kevin Heybourne and Angel Witch perform their song „Angel Witch“ taken off the album „Angel Witch“ and therefore unleash an unholy power. Your brain will be consumed by the song immediatly.<br /> That’s for sure – wanna bet?</p>",detailLink:"/de/programm/bands/band/angel-witch/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OiqBMtVAWhQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Angel_Witch-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Angel_Witch-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30234}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3601,uri:"https://www.angelwitchcoven.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3602,uri:"https://www.facebook.com/angelwitchofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6L48AOtGmQL1ELLoKML7cS",subtitle:"",thumbnail:"/fileadmin/_processed_/8/f/csm_Angel_Witch-WOA25-Ankuenderbild_b9a6c3cb94.jpg",uid:1287},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"apocalyptica",title:"Apocalyptica",uid:957},biography:"<p>There are only a handful of groups in the Metal universe that can claim that they have written history. Even less can claim, that they did it over and over again.<br /> Curtains up for Apocalyptica and their unique way in Metal. A band almost as old as the W:O:A. A band who not only play Metal classics on classical instruments but they have also become a classic themselves.<br /> We can not wait for another spectacular show on the Holy Ground.</p>",detailLink:"/de/programm/bands/band/apocalyptica/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=-5OGVn8bkbA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Apokalyptica-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Apokalyptica-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30169}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3568,uri:"https://www.apocalyptica.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3569,uri:"https://www.facebook.com/Apocalyptica/"},{socialnetwork:{title:"Instagram",uid:5},uid:3570,uri:"https://www.instagram.com/apocalypticaofficial/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Lm0pUvmisUHMdoky5ch2I",subtitle:"",thumbnail:"/fileadmin/_processed_/4/b/csm_Apokalyptica-WOA25-Ankuenderbild_32a618c395.jpg",uid:1275},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"august-burns-red",title:"August Burns Red",uid:965},biography:`<p>August Burns Red, the American Metalcore titans, are returning to Wacken! Formed in 2003, the band is known for their technical prowess, powerful breakdowns, and thought-provoking lyrics. With standout albums like "Messengers" and "Constellations", they've earned a massive global following. Their intense live performances are a testament to their energy and skill. Don't miss August Burns Red at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/august-burns-red/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=BTQQtHJ-fDY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"august_burns_red24.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/august_burns_red24.jpg",title:"",type:2,uid:30332}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3619,uri:"https://www.facebook.com/augustburnsred/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3620,uri:"https://www.instagram.com/augustburnsred/"},{socialnetwork:{title:"Homepage",uid:8},uid:3621,uri:"https://www.google.com/search?q=august+burns+red+homepage&client=safari&sca_esv=a36414378d11ac08&sca_upv=1&rls=en&ei=BIezZtvwIJCHxc8PqprBuAQ&oq=august+burns+red+homepa&gs_lp=Egxnd3Mtd2l6LXNlcnAiF2F1Z3VzdCBidXJucyByZWQgaG9tZXBhKgIIADIHECEYoAEYCjIHECEYoAEYC"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5p9CTsn5ueGU4oScNX1axu",subtitle:"",thumbnail:"/fileadmin/_processed_/0/e/csm_august_burns_red24_a0e17bb878.jpg",uid:1294},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"benediction",title:"Benediction",uid:398},biography:'<p class="docData;DOCY;v5;2000;">Benediction are finally back! 26 years after the British Death Metal outfit last set foot on the Holy Ground, they have returned. And that’s not all: you won’t even have to miss out on Dave Ingram. Get ready for late ’80s British Death Metal, get ready for rapid-fire double bass blasts and get ready for the pit! It’s going to be old-school.</p>',detailLink:"/de/programm/bands/band/benediction/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=GgQKuZNIukU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"benediction_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/benediction_25.jpg",title:"",type:2,uid:30715}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3628,uri:"https://www.facebook.com/Benedictionband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3629,uri:"https://www.instagram.com/benediction_band"},{socialnetwork:{title:"Youtube",uid:6},uid:3630,uri:"https://www.youtube.com/watch?v=MUcd_koHUn8"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1Lx9Dy5gi2OLlJBBs7GYO7",subtitle:"",thumbnail:"/fileadmin/_processed_/0/9/csm_benediction_25_4080a52f06.jpg",uid:1297},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[{artists:[{title:"Beyond The Black",uid:84}],end:"1722693600",festival:null,festivalday:{end:"1722740400",start:"1722664800",title:"Saturday",uid:22},images:null,media:null,performance:{title:"Concert",uid:1},stage:{description:"",latitude:"",longitude:"",pid:167,sorting:"256",subtitle:"powered by LGH Wacken",title:"LGH Clubstage",uid:21},start:"1722690000",subtitle:"",sysLanguageUid:"-1",teaser:"",title:"Unplugged and Q&A",uid:1687}],pathSegment:"beyond-the-black",title:"Beyond The Black",uid:84},biography:"<p>To introduce Beyond The Black might seem a little pointless – the German symphonic Metal superstars with frontwoman Jennifer Haben have become modern Metals giants in the meantime.<br /> Especially their breathtaking live-shows put them into the top tier of Heavy Metal – and somehow we might have introduced them now a little bit.</p>",detailLink:"/de/programm/bands/band/beyond-the-black/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=QKW7_jOjTQ8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Beyond_The_Black-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Beyond_The_Black-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30235}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3603,uri:"http://beyond-the-black.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3604,uri:"https://www.facebook.com/beyondtheblackofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3605,uri:"https://www.instagram.com/beyondtheblack_official"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6swnqiL41Bd4gO2fnAXXrf",subtitle:"",thumbnail:"/fileadmin/_processed_/0/a/csm_Beyond_The_Black-WOA25-Ankuenderbild_4b9cd3da21.jpg",uid:1288},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"brothers-of-metal",title:"Brothers of Metal",uid:324},biography:"<p>What would you do with 8 people? You could start a handball club or put rings on 80 fingers.<br /> Or you found a Metal band, call it Brothers of Metal and then perform Power-Metal on our Wacken Open Air stages!</p>",detailLink:"/de/programm/bands/band/brothers-of-metal/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Be_CyeFqziY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Brothers_of_Metal-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Brothers_of_Metal-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30236}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3606,uri:"https://www.facebook.com/brothersofmetalofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3607,uri:"https://www.instagram.com/brothersofmetalofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0WPCPYm5IDNtQjuJOGNPcy",subtitle:"",thumbnail:"/fileadmin/_processed_/5/b/csm_Brothers_of_Metal-WOA25-Ankuenderbild_27a384474d.jpg",uid:1289},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"callejon",title:"Callejon",uid:971},biography:"<p>The founding fathers of German Metalcore are back to honor the Holy Ground. A lot has happened since they last graced these stages in 2016—new albums, and additionally in 2024, quite a spectacular shake-up in the lineup. With fresh band members, Callejon are now ready to take another spin on the wild excitement and insatiable energy that leads to the bittersweet longing, the kind that knows eternity can only be found in the fleeting nature of all things.<br /> &nbsp;</p>",detailLink:"/de/programm/bands/band/callejon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=m-rumep8WdI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"callejon25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/callejon25.jpg",title:"",type:2,uid:32215}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3651,uri:"https://www.callejon.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3652,uri:"https://www.facebook.com/@callejon"},{socialnetwork:{title:"Instagram",uid:5},uid:3653,uri:"https://www.instagram.com/callejon/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1ce15ppX5OYxPsBVESZG3W",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_callejon25_c86c940092.jpg",uid:1304},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"celeste",title:"Celeste",uid:943},biography:"<p>It is not the easiest task putting the French avant-gardists Celeste into a box. The band is known to be one of the best of what modern Black Metal has to offer for more than 15 years.<br /> The band’s influences are as diverse as the study of the classic color theory. Black is described as the absence of all colors – Celeste is the darkest of Black-Metal. The absence of genre-borders and their corset provide the ultimate darkness.</p>",detailLink:"/de/programm/bands/band/celeste/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=bvyb7LaFZUo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Celeste-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Celeste-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30156}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3530,uri:"https://www.instagram.com/celeste_band/"},{socialnetwork:{title:"Facebook",uid:1},uid:3531,uri:"https://www.facebook.com/celesteband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3532,uri:"https://celesteband.com/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"16HYItTmZdhXM4Yz0CPtVy",subtitle:"",thumbnail:"/fileadmin/_processed_/7/f/csm_Celeste-WOA25-Ankuenderbild_61e253d3af.jpg",uid:1260},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"clawfinger",title:"Clawfinger",uid:390},biography:`<p>Clawfinger, the Swedish Rap-Metal pioneers, are set to ignite Wacken 2025! Formed in 1989, Clawfinger is renowned for their aggressive blend of Metal and Rap, delivering hard-hitting lyrics and powerful performances.<br /> With iconic tracks like "Do What I Say", they've carved a unique niche in the Metal world. Their dynamic live shows and genre-defying sound promise an stirring experience. Get ready for Clawfinger at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/clawfinger/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=47Yb2aWmuVI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Clawfinger-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Clawfinger-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30226}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3589,uri:"http://www.clawfinger.net/"},{socialnetwork:{title:"Facebook",uid:1},uid:3590,uri:"https://www.facebook.com/clawfinger.net/"},{socialnetwork:{title:"Instagram",uid:5},uid:3591,uri:"https://www.instagram.com/clawfingerofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1xE3snzm12GBK259IqEFlY",subtitle:"",thumbnail:"/fileadmin/_processed_/d/9/csm_Clawfinger-WOA25-Ankuenderbild_cf938e0fc1.jpg",uid:1282},{artist:{country:[{nameLocalized:"Australien",shortNameDe:"Australien",shortNameEn:"Australia",uid:14}],events:[],pathSegment:"clowns",title:"Clowns",uid:960},biography:"<p>Chances are, that the genre-mixing Clowns might travelt the farthest to the Holy Ground in 2025.<br /> The Austrialians are also rumored to disturb the mullet balance extensively, we might have to have a closer look on this subject.<br /> Besides that, we hired them as demolition constructors – busy people, these clowns.</p>",detailLink:"/de/programm/bands/band/clowns/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OHCNVTg3O2Q&list=OLAK5uy_lFQM7jQqLWxUMxDx0O7z2w1X568kzeV2c",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Clowns-WOA25-Ankuenderbild2.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Clowns-WOA25-Ankuenderbild2.jpg",title:"",type:2,uid:30225}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3577,uri:"https://clownsband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3578,uri:"https://www.facebook.com/clownsband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3579,uri:"https://www.instagram.com/clownsband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2TuGrkN9bcjWU1GcrUarYn",subtitle:"",thumbnail:"/fileadmin/_processed_/4/4/csm_Clowns-WOA25-Ankuenderbild2_2cd41284a0.jpg",uid:1278},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"crownshift",title:"Crownshift",uid:961},biography:"<p>Scandinavia – in modern Metal it is nearly a synonym for quality. That’s why it is no wonder why this supergroup (members of Children of Bodom, Finntroll &amp; Wintersun) is the real deal right now.<br /> After 2023 we are very glad that they decided to return to the W:O:A once again.</p>",detailLink:"/de/programm/bands/band/crownshift/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7OzTbJEucW0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"crownshit_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/crownshit_25.jpg",title:"",type:2,uid:30264}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3580,uri:"https://www.crownshiftofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3581,uri:"https://www.facebook.com/crownshiftofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3582,uri:"https://www.instagram.com/crownshiftofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6Fd8KYTCfbveVIsHVSr2y6",subtitle:"",thumbnail:"/fileadmin/_processed_/8/6/csm_crownshit_25_f9c3db038b.jpg",uid:1279},{artist:{country:[{nameLocalized:"Polen",shortNameDe:"Polen",shortNameEn:"Poland",uid:170}],events:[],pathSegment:"decapitated",title:"Decapitated",uid:941},biography:"<p>Some bands become famous because of their undeniable musical abilites, others become legends because of tragic circumstances, e.g passing away of band members.<br /> Decapitated is easily put in both categories. Yet, in 2025, a powerful, technical skilled Death Metal machine is ready for the Holy Ground, just waiting to unleash it’s deadly riffs.</p>",detailLink:"/de/programm/bands/band/decapitated/",externalMediaRatio:"16by9",externalMediaSource:"https://www.decapitatedband.net/",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Decapitated-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Decapitated-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30153}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3525,uri:"https://www.facebook.com/decapitated/"},{socialnetwork:{title:"Instagram",uid:5},uid:3526,uri:"https://www.instagram.com/decapitatedband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3527,uri:"https://www.decapitatedband.net/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"17MbhJOaaPHuWnRaWU9xkc",subtitle:"",thumbnail:"/fileadmin/_processed_/0/4/csm_Decapitated-WOA25-Ankuenderbild_244905b8e3.jpg",uid:1258},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"destruction",title:"Destruction",uid:936},biography:"<p>Teutonen-Alarm! Seit über 40 Jahren bespielen Destruction die Bühnen dieser Welt. Zusammen mit Kreator und Sodom gehören sie unbestritten zur Speerspitze des deutschen Thrash. Und auch beim W:O:A sind sie keine Unbekannten – 2025 wird die gut geSCHMIERte Maschine ihre Hochgeschwindigkeitsgranaten wieder auf unseren Holy Ground abfeuern. Geht in Deckung!</p>",detailLink:"/de/programm/bands/band/destruction/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_ctRQ465GLE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Destruction-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Destruction-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30147}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3512,uri:"https://www.facebook.com/destruction/?locale=pt_BR"},{socialnetwork:{title:"Instagram",uid:5},uid:3513,uri:"https://www.instagram.com/destruction_official"},{socialnetwork:{title:"Homepage",uid:8},uid:3514,uri:"https://www.destruction.de/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5d6KI8frPEo3qGsIL8Sak2",subtitle:"",thumbnail:"/fileadmin/_processed_/5/d/csm_Destruction-WOA25-Ankuenderbild_eb8fa786e7.jpg",uid:1253},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"devildriver",title:"Devildriver",uid:977},biography:`<p class="docData;DOCY;v5;3300;">Dez Fafara, the man behind DevilDriver and mastermind of Coal Chamber, could totally just chill and live off his past. After all, he was one of the main architects of that monster we called Nu-Metal back in the '90s. But nah, he’s not doing that. With DevilDriver, he’s straight-up rejecting the flashy side of our favorite amplifier-driven music and has been banging out solid Groove Metal since 2002. And now, after 9 years, he’s finally bringing it back to Wacken.</p>`,detailLink:"/de/programm/bands/band/devildriver/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=YkbPhYGb8ns&t=1s",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Devildriver25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Devildriver25.jpg",title:"",type:2,uid:32572}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3681,uri:"https://devildriver.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3682,uri:"https://www.facebook.com/devildriver"},{socialnetwork:{title:"Instagram",uid:5},uid:3683,uri:"https://www.instagram.com/devildriver/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"79el7mcHYhXYW3Zek21i0L",subtitle:"",thumbnail:"/fileadmin/_processed_/8/8/csm_Devildriver25_b34f8ca3e7.jpg",uid:1314},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"dimmu-borgir",title:"Dimmu Borgir",uid:956},biography:"<p>For another time the unholy fortress sends their evil representatives to Wacken and persuade all the Metalheads to headbang. Since their founding in 1993, the Norwegians have earned the reputation of being one of the most popular Metal bands in the world.<br /> Songs like „Progenies of the Great Apocalypse“ or „Sorgens Kammer“ are an established part in the collective Metal brain.<br /> <br /> The band is especially memorable to both you and us from 2012, when they, also thanks to an orchestra, transformed the Holy Ground into the Unholy Ground and enveloped the W:O:A with their bombastic Black Metal in delightfully eerie darkness.<br /> We look forward to something remarkable!</p>",detailLink:"/de/programm/bands/band/dimmu-borgir/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=cb26HASeyvM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dimmu_borgir24.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dimmu_borgir24.jpg",title:"",type:2,uid:31004}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3565,uri:"https://www.dimmu-borgir.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3566,uri:"https://www.facebook.com/dimmuborgir/"},{socialnetwork:{title:"Instagram",uid:5},uid:3567,uri:"https://www.instagram.com/dimmuborgir/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6e8ISIsI7UQZPyEorefAhK",subtitle:"",thumbnail:"/fileadmin/_processed_/c/d/csm_dimmu_borgir24_67b6b22ad9.jpg",uid:1274},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"dirkschneider",title:"Dirkschneider",uid:283},biography:`<p>Maybe the greatest Metal album of the '80s? With possibly <em>the</em> greatest Metal anthem ever created? No one can escape the power of "Balls to the Wall," and when it’s Udo Dirkschneider himself delivering the iconic fist-pumping scream – it doesn’t get any better than that. Or does it? Since 2023, Udo’s band has been graced with the cherry on top: bass god Peter Baltes is back. We’re beyond stoked and can’t wait for this absolutely legendary show where we will be celebrating the 40th anniversary of this epic record!</p>`,detailLink:"/de/programm/bands/band/dirkschneider/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OczPkwrA-ZA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dirkschneider25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dirkschneider25.jpg",title:"",type:2,uid:32216}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3654,uri:"https://www.udo-online.com/news-98.html"},{socialnetwork:{title:"Facebook",uid:1},uid:3655,uri:"https://www.facebook.com/DIRKSCHNEIDEROfficial"},{socialnetwork:{title:"Youtube",uid:6},uid:3656,uri:"https://www.youtube.com/user/UDOtubetv"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Ki97iRlfQmVk6qw5tXULX",subtitle:"",thumbnail:"/fileadmin/_processed_/5/e/csm_dirkschneider25_aaa2c43d38.jpg",uid:1305},{artist:{country:[{nameLocalized:"Italien",shortNameDe:"Italien",shortNameEn:"Italy",uid:104}],events:[],pathSegment:"dogma",title:"Dogma",uid:972},biography:`<p>„Dogma is what you want it to be. A cult, a sect, a secret society, a band, a musical, a documentary…You decide what we are. We demand only one thing: to be part of your new life. Welcome to your new life. Welcome to Dogma.”</p>\r
<p>Prepare to sin with Dogma! Over the years, Dogma has risen to become an unstoppable force, and we’re thrilled to witness this spectacle here in Wacken. The four women—Lilith (vocals), Lamia (lead guitar), Nixe (bass), and Abrahel (drums)—are on a mission: using their music as a weapon against ignorance and oppression. They excel at inspiring their audience to question everything and challenge the status quo. We can’t wait to welcome them to the Holy Ground.</p>`,detailLink:"/de/programm/bands/band/dogma/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=h7Qg_EU_ehI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dogma_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dogma_25.jpg",title:"",type:2,uid:32217}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3657,uri:"https://officialdogma.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3658,uri:"https://www.instagram.com/officialdogma/"},{socialnetwork:{title:"Facebook",uid:1},uid:3659,uri:"https://www.facebook.com/@theofficialdogma"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4R6XPuqGShFESRVkCePaxj",subtitle:"",thumbnail:"/fileadmin/_processed_/7/4/csm_dogma_25_a12354dfa1.jpg",uid:1306},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"dominum",title:"Dominum",uid:962},biography:"<p>Dr. Dead lets his zombies dance. Dominum will infect you with their Power Metal and they don’t even have to bite. At least until you want them to.<br /> One of the most extraordinary bands of German Metal will redeclare the Holy Ground into a buffet. There is no escape Metalheads!</p>",detailLink:"/de/programm/bands/band/dominum/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ASdCjFE2vI0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Dominum-WOA25-Ankuenderbild4.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Dominum-WOA25-Ankuenderbild4.jpg",title:"",type:2,uid:30224}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3583,uri:"https://www.dominumofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3584,uri:"https://www.facebook.com/realdominum/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3585,uri:"https://www.instagram.com/realdominum"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Nm9FxM65RZa6EgFV2z8S9",subtitle:"",thumbnail:"/fileadmin/_processed_/e/9/csm_Dominum-WOA25-Ankuenderbild4_21a34011b8.jpg",uid:1280},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"dool",title:"Dool",uid:944},biography:"<p>Dool’s dominating theme is change. Change in life, change in line-ups, and change in music. Which is very fitting considering the band’s name translates in dutch to “wander”.<br /> Let the 5 guys of Dool take you on a journey through different genres of Metal music. Maybe, in the end, it will change your perspective too?</p>",detailLink:"/de/programm/bands/band/dool/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=FAOJe3lSXqI&list=OLAK5uy_mMCPUp-0w0I2jH0gw7GUHrok_2u2a5KiI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Dool-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Dool-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30155}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3533,uri:"https://allthosewhowanderaredool.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3534,uri:"https://www.facebook.com/allthosewhowanderaredool/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3535,uri:"https://www.instagram.com/allthosewhowanderaredool/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"101HSR6JTJqe3DBh6rb8kz",subtitle:"",thumbnail:"/fileadmin/_processed_/f/b/csm_Dool-WOA25-Ankuenderbild_54fbbdf7e5.jpg",uid:1261},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"enemy-inside",title:"Enemy Inside",uid:573},biography:"<p>After their successful debut in 2023 Enemy Inside makes their return to Wacken. Founded by the German-Italian outstanding voice Nastassja Giulia and guitarist Evan K in 2017, they found their home between Dark-Rock and Modern Metal. Dominik Stotzem on bass-guitar and Dave Hadarik on guitar complete the line-up . As the Holy Ground already witnessed Enemy Inside proves themselves with intense and captivating moments during their live shows. Their presence is inevitable, which is why we are excited to welcome them again to see their mesmerizing show. &nbsp;</p>",detailLink:"/de/programm/bands/band/enemy-inside/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=AYLjMw2KCMM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"enemy_inside25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/enemy_inside25.jpg",title:"",type:2,uid:32218}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3660,uri:"https://enemy-inside.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3661,uri:"https://www.facebook.com/WeAreEnemyInside/"},{socialnetwork:{title:"Instagram",uid:5},uid:3662,uri:"https://www.instagram.com/weareenemyinside/"},{socialnetwork:{title:"Youtube",uid:6},uid:3663,uri:"https://www.youtube.com/channel/UC7Xt2agmtcN60kxbOvYs25Q"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4DX0ctdZRMWec9KCiigIXy",subtitle:"",thumbnail:"/fileadmin/_processed_/5/4/csm_enemy_inside25_0c5b20e588.jpg",uid:1307},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"exhorder",title:"Exhorder",uid:945},biography:"<p>Imagine forming a band, release records, go on tour, and basically live out your dreams for 6 years. And then, the dream suddenly implodes.<br /> 27 years later: You’re back with a loud bang! Exhorder are back to fire up and explode on the Holy Ground in 2025.<br /> Along with them: Their new record Defectum Onium. The dream is alive again!</p>",detailLink:"/de/programm/bands/band/exhorder/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ea8OpEJxmiM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Exhorder-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Exhorder-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30157}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3536,uri:"https://www.exhorder.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3537,uri:"https://www.instagram.com/exhorderofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5kuYamMO00pHPdRQcAXWTl",subtitle:'"Slaughter in the Vatican" Show',thumbnail:"/fileadmin/_processed_/8/a/csm_Exhorder-WOA25-Ankuenderbild_0aeb91b447.jpg",uid:1262},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"forbidden",title:"Forbidden",uid:978},biography:'<p class="docData;DOCY;v5;2658;">Forbidden are like the cigarette your parents refused to let you smoke. Like the liquor they didn’t want you to drink, or those friends they disapproved of. Of course, you did all of it anyway, because nothing felt as good! Well, except maybe taking a dive into the moshpit – which will safely happen when these Thrashers take the stage. Safe like the grounding your parents gave you after your first bender! With Forbidden, an absolute Thrash legend is coming to the Holy Ground, and this time, no one can stop you. Go get your kicks!</p>',detailLink:"/de/programm/bands/band/forbidden/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Lm6TPJgiN6A",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"forbidden_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/forbidden_25.jpg",title:"",type:2,uid:32633}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3684,uri:"https://officialforbidden.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3685,uri:"https://www.facebook.com/forbiddenofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3686,uri:"https://www.instagram.com/official_forbidden/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5MhPZVXE28sD9rXE3GU1uN",subtitle:"",thumbnail:"/fileadmin/_processed_/7/e/csm_forbidden_25_54de2fd914.jpg",uid:1315},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"gojira",title:"Gojira",uid:946},biography:"<p>Buckle up - Gojira are coming back! The hype around the band remains unbroken - completely justified. The wide spectrum of styles, which are virtuosly united in their music, has already made them living legends for many of you.<br /> It’s rare for a band to command the stage as well as the music so breathtakingly as the frenchmen do. The only thing that can top the inauguration of the Olympic Games in Paris last year is a Headliner slot at W:O:A. Let’s get started!</p>",detailLink:"/de/programm/bands/band/gojira/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kl-2GUMijPM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Gojira-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Gojira-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30158}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3538,uri:"https://www.gojira-music.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3539,uri:"https://www.instagram.com/gojiraofficial/"},{socialnetwork:{title:"Facebook",uid:1},uid:3540,uri:"https://www.facebook.com/GojiraMusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0GDGKpJFhVpcjIGF8N6Ewt",subtitle:"",thumbnail:"/fileadmin/_processed_/6/d/csm_Gojira-WOA25-Ankuenderbild_b5154c78ac.jpg",uid:1263},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"grave-digger",title:"Grave Digger",uid:294},biography:"<p>Is this the smell of a legend? Chris Boltendahl and the mighty Grave Digger have been belonging to German Metal music for such a long time that their legend-status is well justified and earned.<br /> Grave Digger are a real institution after 45 years of experience and will be celebrating this anniversary with us on the Holy Ground.<br /> Real Teutonic Metal will be awaited for everyone who wants to dry their hair infront of the stage.</p>",detailLink:"/de/programm/bands/band/grave-digger/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=xtShAqcxhkY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"gravedigger25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/gravedigger25b.jpg",title:"",type:2,uid:32194}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3592,uri:"https://www.grave-digger-clan.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3593,uri:"https://www.facebook.com/gravediggerofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3594,uri:"https://www.instagram.com/gravediggerband/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6mfghV4I1CD17FOhDKq7cJ",subtitle:"45th Anniversary Show",thumbnail:"/fileadmin/_processed_/1/3/csm_gravedigger25b_dc6e593869.jpg",uid:1283},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"guns-n-roses",title:"Guns N’ Roses",uid:983},biography:"<p>Guns N’ Roses endure as the most dynamic, dangerous, and definitive American rock band in history to this day. Embedded in popular culture, their landmark diamond-selling 1987 opus,&nbsp;<em>Appetite For Destruction</em>, stands out as&nbsp;<em>“the best-selling U.S. debut album ever”&nbsp;</em>and&nbsp;<em>“the 11</em><em><sup>th</sup></em><em>&nbsp;best-selling U.S. album of all&nbsp;</em>time,<em>”&nbsp;</em>while their&nbsp;<em>Not In This Lifetime… Tour&nbsp;</em>(2016-2019) ranked as the&nbsp;<em>“fourth-highest grossing concert tour of all time</em>.<em>”&nbsp;</em>During 1991, Guns N’ Roses shook the world with the one-two punch of the 7x-platinum&nbsp;<em>Use Your Illusion I</em>&nbsp;and&nbsp;<em>Use Your Illusion II</em>, clinching the top two spots of the&nbsp;<em>Billboard</em>&nbsp;200 upon arrival. With total sales of 100 million units thus far, their catalog also consists of&nbsp;<em>G N’ R Lies</em>&nbsp;(5x-platinum),&nbsp;<em>The Spaghetti Incident?</em>(platinum),&nbsp;<em>Greatest Hits&nbsp;</em>(5x-platinum), and&nbsp;<em>Chinese Democracy</em>&nbsp;(platinum). Not to mention, they are one of the most-streamed rock bands in the world with an average of 24 million monthly listeners on Spotify. Following the reunion of the century, they headlined&nbsp;<em>Coachella</em>&nbsp;and sold 5 million-plus tickets on the&nbsp;<em>Not In This Lifetime… Tour</em>. However, Guns N’ Roses never stop with more touring on the horizon and other surprises—the<em>&nbsp;“Nightrain”</em>&nbsp;keeps rolling at full speed.&nbsp;&nbsp;&nbsp;<br /> <br /> Guns N’ Roses are Axl Rose (vocals, piano), Duff McKagan (bass), Slash (lead guitar), Dizzy Reed (keyboard), Richard Fortus (rhythm guitar), Frank Ferrer (drums), and Melissa Reese (keyboard).  &nbsp;</p>",detailLink:"/de/programm/bands/band/guns-n-roses/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=FcJfZ9jjwrY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"GunsNRoses_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/GunsNRoses_25.jpg",title:"",type:2,uid:32599}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3703,uri:"https://www.gunsnroses.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3704,uri:"https://www.facebook.com/gunsnroses"},{socialnetwork:{title:"Instagram",uid:5},uid:3705,uri:"https://www.instagram.com/gunsnroses/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3qm84nBOXUEQ2vnTfUTTFC",subtitle:"",thumbnail:"/fileadmin/_processed_/b/f/csm_GunsNRoses_25_004b10f80c.jpg",uid:1322},{artist:{country:[{nameLocalized:"Japan",shortNameDe:"Japan",shortNameEn:"Japan",uid:107}],events:[],pathSegment:"hanabie",title:"Hanabie",uid:947},biography:`<p>Here comes Hanabie - The Japanese Metal phenomenon, that currently sets the world on fire.</p>\r
<p>In their repertoire: Electrifying live-shows and mesmerizing sounds.<br /> The band formed in Tokyo, that combines Metalcore elements with Japanese Pop-Music, will enchant the W:O:A 2025. Here comes: The Beast from The East!</p>`,detailLink:"/de/programm/bands/band/hanabie/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=vdZFDaCjQ0w",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hanabie-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hanabie-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30159}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3541,uri:"https://www.instagram.com/ha_na_bie_/"},{socialnetwork:{title:"Homepage",uid:8},uid:3542,uri:"https://hanabie.jp/en/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4N2I7VsF86h59tbsvVoB1h",subtitle:"",thumbnail:"/fileadmin/_processed_/4/a/csm_Hanabie-WOA25-Ankuenderbild_943ee8cf36.jpg",uid:1264},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"hellbutcher",title:"Hellbutcher",uid:937},biography:"<p>You’ll get Hellbutcher out of Nifelheim, but never Nifelheim out of the Hellbutcher. The name already tells us what’s awaiting us. Of course, it’s the same taste that we have always liked and admired.<br /> They provide the best mix out of Black Metal, Motörhead and traditional Metal a la Judas Priest! The gates of hell open their portals and spit out the Scandinavians onto the Holy Ground – It can not get better than this.</p>",detailLink:"/de/programm/bands/band/hellbutcher/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hellbutcher-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hellbutcher-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30148}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3515,uri:"https://www.facebook.com/hellbutcherchile/"},{socialnetwork:{title:"Instagram",uid:5},uid:3516,uri:"https://www.instagram.com/hellbutcherband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3517,uri:"https://hellbutcher.com/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0LNxFESoHHXMTsh5RIl8L2",subtitle:"",thumbnail:"/fileadmin/_processed_/2/9/csm_Hellbutcher-WOA25-Ankuenderbild_1b6a4ef55e.jpg",uid:1254},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"iotunn",title:"Iotunn",uid:948},biography:'<p>The Danish outfit Iotunn invites you on a cosmic journey on the Holy Ground. With floating soundscapes and immense vocal range, they open a portal to another galaxy right before your eyes. Epic songs reach out to you and pull you in. With their latest album "Kinship", the band has achieved a milestone that stands unmatched in the current Heavy Metal cosmos. The only question&nbsp;which remains: Are you ready to be drawn into the complexity of these masters?</p>',detailLink:"/de/programm/bands/band/iotunn/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KSQG8r6tWaY&list=OLAK5uy_lw1gQ0p2hroa1R6w-6LHg9uWpijngSEM4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Iotunn-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Iotunn-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30160}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3543,uri:"https://www.facebook.com/iotunn/"},{socialnetwork:{title:"Instagram",uid:5},uid:3544,uri:"https://www.instagram.com/iotunn/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3yJvUOZq6oH130RTa68hQz",subtitle:"",thumbnail:"/fileadmin/_processed_/3/4/csm_Iotunn-WOA25-Ankuenderbild_ee2138a7fb.jpg",uid:1265},{artist:{country:[{nameLocalized:"Brasilien",shortNameDe:"Brasilien",shortNameEn:"Brazil",uid:29}],events:[],pathSegment:"krisiun",title:"Krisiun",uid:949},biography:"<p>Emerging from the deep forests and riverbeds of the Amazonas a deathbringing monster paths it’s way to the W:O:A 2025. Merciless guitar-riffs are drilling through everything that stands in their way.<br /> Nothing is capable to stand against this primordial power. It only stops just right before arriving at the Holy Ground. Krisiun are back in Wacken!</p>",detailLink:"/de/programm/bands/band/krisiun/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=y0xFqFlJfK8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Krisiun-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Krisiun-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30161}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3545,uri:"https://www.facebook.com/krisiun.official/"},{socialnetwork:{title:"Instagram",uid:5},uid:3546,uri:"https://www.instagram.com/krisiun/"},{socialnetwork:{title:"Homepage",uid:8},uid:3547,uri:"https://krisiun.com.br"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3pzAW9xs16rX8fukH8wV6N",subtitle:"Special 90s Set",thumbnail:"/fileadmin/_processed_/5/f/csm_Krisiun-WOA25-Ankuenderbild_cd0a41aec4.jpg",uid:1266},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"kylesa",title:"Kylesa",uid:973},biography:"<p>After a decade away from the stage, we are beyond excited to welcome Kylesa back for their 25th anniversary with an almost exclusive performance on the Holy Ground! Phillip Cope and Laura Pleasants are masters at pushing boundaries and refuse to be confined to a single genre. Their sound is unmistakable and clearly could not be forgotten during the last ten years. We couldn’t be more thrilled that Kylesa is joining us for Wacken 2025—this is going to be an unforgettable experience.</p>",detailLink:"/de/programm/bands/band/kylesa/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=VlbC-hk25Aw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"kylesa25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/kylesa25.jpg",title:"",type:2,uid:32219}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3664,uri:"https://www.kylesamusic.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3665,uri:"https://www.facebook.com/KYLESAmusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3666,uri:"https://www.instagram.com/Kylesa_band/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7mO0JGOATH8fVHvgCdZsXh",subtitle:"",thumbnail:"/fileadmin/_processed_/a/b/csm_kylesa25_dde1bd5836.jpg",uid:1308},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"lake-malice",title:"Lake Malice",uid:981},biography:'<p class="docData;DOCY;v5;2963;">They are influenced by Japanese anime style and everyday life in all its painful and traumatic ways. Lake Malice from Brighton, UK, are musicians Alice Guala and Blake Cornwall. The duo has already been nominated twice at the Heavy Music Awards, played headline shows in their home country of England and in Germany. Now&nbsp;another highlight is added with their show at W:O:A 2025, that is promising to be quite some spectacle.</p>',detailLink:"/de/programm/bands/band/lake-malice/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=W-QSp4NkeoI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lake_malice25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lake_malice25.jpg",title:"",type:2,uid:32577}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3695,uri:"https://www.facebook.com/lakemalice/"},{socialnetwork:{title:"Instagram",uid:5},uid:3696,uri:"https://www.instagram.com/lakemalice/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4zoN3D2RviWzWeHvkT3wWO",subtitle:"",thumbnail:"/fileadmin/_processed_/d/d/csm_lake_malice25_2cbab12b4a.jpg",uid:1319},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"lakeview",title:"Lakeview",uid:976},biography:'<p class="docData;DOCY;v5;3488;">What already works perfectly in small restaurants and church basements as well as in large arenas is even better suited for Wacken: The Country-Rock duo Lakeview from Nashville has plenty of real-life stories to tell on their self-titled debut album. Jesse and Luke got pure dynamite to share with the world - after all, they both had their hearts broken by the same woman, share a passion for Metalcore and a blue-collar background. The two-piece also already has proven its songwriting abilities for acts like Breaking Benjamin. The success of their first single "Home Team" is therefore no surprise. Next up in a so far highlight-driven career: The Holy Ground in Wacken.</p>',detailLink:"/de/programm/bands/band/lakeview/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/SJUpod5a9hY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lakeview_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lakeview_25.jpg",title:"",type:2,uid:32571}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3678,uri:"https://www.lakeviewofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3679,uri:"https://www.facebook.com/lakeviewofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3680,uri:"https://www.instagram.com/lakeview"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4m7IOKt2QRPsoHJSWBmeZD",subtitle:"",thumbnail:"/fileadmin/_processed_/4/8/csm_lakeview_25_f4fb48b76b.jpg",uid:1313},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"liliac",title:"Liliac",uid:974},biography:"<p>What happens when five siblings grow up in a musical household with a father being a music producer? The answer: Liliac! Founded in 2015, the Rock band gained attention with a stunning performance on America’s Got Talent and has released several albums and cover songs. The Metal vamps are mysterious and theatrical, just as their band name suggests. Sprung out of the Romanian language Liliac means bat.</p>",detailLink:"/de/programm/bands/band/liliac/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=xrtMmOYoUCI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"liliac25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/liliac25.jpg",title:"",type:2,uid:32220}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3667,uri:"https://www.liliacband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3668,uri:"https://www.facebook.com/liliacband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3669,uri:"https://www.instagram.com/liliacband/"},{socialnetwork:{title:"Youtube",uid:6},uid:3670,uri:"https://www.youtube.com/@LILIACBAND"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"59JYc4smLqWbRz93IzN5lw",subtitle:"",thumbnail:"/fileadmin/_processed_/3/0/csm_liliac25_2840a02f6d.jpg",uid:1309},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"lita-ford",title:"Lita Ford",uid:979},biography:`<p class="docData;DOCY;v5;2536;">First making a name for herself with The Runaways, later building a successful solo career and surviving a marriage to Chris Holmes (formerly of W.A.S.P.), Lita Ford lives and breathes Metal! Throughout her not-always-easy career, this exceptional guitarist and unforgettable singer has seen many highlights – but the Holy Ground and the unique Wacken experience were not among them. Until now.</p>\r
<p>In 2025, she will finally grace us with a show. Welcome to Wacken, Lita Ford!</p>`,detailLink:"/de/programm/bands/band/lita-ford/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kIt3OGra3Lo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lita_ford_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lita_ford_25.jpg",title:"",type:2,uid:32575}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3690,uri:"http://www.litafordonline.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3691,uri:"https://www.facebook.com/litaofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3692,uri:"https://www.instagram.com/litafordofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"77tBvvyd6SD4Y9Um1xcbxP",subtitle:"",thumbnail:"/fileadmin/_processed_/2/0/csm_lita_ford_25_7acf0e3606.jpg",uid:1317},{artist:{country:[],events:[],pathSegment:"macabre",title:"Macabre",uid:967},biography:'<p class="docData;DOCY;v5;2636;">When Chicago’s Macabre visited W:O:A for the first and only time in 2002 there was no Instagram or Whatsapp&nbsp;.The world was a different one than it is today. Long before Netflix discovered Jeffrey Dahmer, the group released a concept album about the Milwaukee serial killer 20 years earlier. In general, serial killers seem to have a special appeal to the Death Metal trio, as a large portion of their songs focus on this theme. Consistency also plays a big role: Macabre has existed with the same line-up since their founding in 1985.</p>',detailLink:"/de/programm/bands/band/macabre/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7KevkZrLKi4&list=OLAK5uy_nYtF4TDnAzZwPARoeBDFADzgDMT2lf168&index=33",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"macabre_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/macabre_25.jpg",title:"",type:2,uid:30714}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3625,uri:"https://www.facebook.com/OFFICIALMACABRE/"},{socialnetwork:{title:"Instagram",uid:5},uid:3626,uri:"https://www.instagram.com/the.real.macabre/"},{socialnetwork:{title:"Youtube",uid:6},uid:3627,uri:"https://www.youtube.com/c/MURDERMETAL1985/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2lbJzDX11fy6cLeFtlkUA8",subtitle:"40th Anniversary Show",thumbnail:"/fileadmin/_processed_/f/5/csm_macabre_25_2c71b42403.jpg",uid:1296},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"machine-head",title:"Machine Head",uid:955},biography:"<p>Only a few names in Wacken History can create such feelings of happiness and nostalgia like Robb Flynn and co. do. Their legendary 2009 show is part of the collective Wacken mind.<br /> And because it was that beautiful, we went ahead and invited the gentlemen again. The groove that underpins their Thrash Metal is unmatched in the Bay Area and probably worldwide.<br /> Additionally, there’s Robb’s undeniable Charisma. We suggest:&nbsp; Get your neck-muscles started.&nbsp;</p>",detailLink:"/de/programm/bands/band/machine-head/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=mgSHazBbDNU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Machine_Head-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Machine_Head-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30167}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3562,uri:"https://www.machinehead1.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3563,uri:"https://www.facebook.com/MachineHead/"},{socialnetwork:{title:"Instagram",uid:5},uid:3564,uri:"https://www.instagram.com/machine_head/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0lVlNsuGaOr9vMHCZIAKMt",subtitle:"",thumbnail:"/fileadmin/_processed_/d/e/csm_Machine_Head-WOA25-Ankuenderbild_7c9b546fec.jpg",uid:1273},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"michael-schenker",title:"Michael Schenker",uid:958},biography:"<p>There are only a few guitarists on this earth which are called a genius, and it is justified. Without a doubt Michael Schenker is one of those.<br /> His career is one of a kind in which the German exceptionalist worked with many different artists, including U.F.O, and yet, his essence was always recognized.<br /> A legacy is putting it’s feet onto the Holy Ground and letting dreams come true with an U.F.O Set.</p>",detailLink:"/de/programm/bands/band/michael-schenker/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=uva_hpLTp_I&list=OLAK5uy_nh-cVXlOu65F2e0PFOmdf1x-R2RranIuE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Michael_Schenker-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Michael_Schenker-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30232}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3571,uri:"https://michaelschenkerhimself.com"},{socialnetwork:{title:"Instagram",uid:5},uid:3572,uri:"https://www.instagram.com/michaelschenkerrocks/"},{socialnetwork:{title:"Facebook",uid:1},uid:3573,uri:"https://www.facebook.com/MichaelSchenkerRocks/?locale=de_DE"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0W36oDVidsOqEIAKUJV4dY",subtitle:"My years with UFO",thumbnail:"/fileadmin/_processed_/b/a/csm_Michael_Schenker-WOA25-Ankuenderbild_e464fefcfb.jpg",uid:1276},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"midnight",title:"Midnight",uid:518},biography:"<p>Messy, belligerent and vile – Midnight creates the soundtrack of fights. They deliver a catchy blend of Black and Speed Metal but also dirty Punk Rock which are relentlessly compulsive.<br /> <em>“I always want it to be loud and nasty.”</em> –&nbsp;One-Man-Army Athenar explains<em>.</em> That’s almost exactly what a Midnight show is about! With “Complete and Total Hell” they bring a mixture of their finest songs to the W:O:A.</p>",detailLink:"/de/programm/bands/band/midnight/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=v5BLur53iDg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Midnight-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Midnight-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30233}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3600,uri:"https://www.facebook.com/Midnight-118528339160/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"28KjD5HkkDDytQzKW7JzTp",subtitle:'"Complete and Total Hell" Set',thumbnail:"/fileadmin/_processed_/7/a/csm_Midnight-WOA25-Ankuenderbild_11d16f7a5f.jpg",uid:1286},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"mimi-barks",title:"Mimi Barks",uid:935},biography:"<p>Time and time again the W:O:A pushed borders and tried out innovative things, that were unthinkable to other festivals.<br /> Mimi Barks and her Doom-Trap surely isn’t a typical Wacken artist. Or is she? What does it take to be a real Wacken artist?<br /> Mimi Barks is right here, right now just right! See you in Wacken!</p>",detailLink:"/de/programm/bands/band/mimi-barks/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=efbZIAosvt8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Mimi_Barks-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Mimi_Barks-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30122}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3510,uri:"https://www.facebook.com/mimibarksofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3511,uri:"https://www.instagram.com/mimibarks/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5A4P1UOSqbSvJKoi3VYlCC",subtitle:"",thumbnail:"/fileadmin/_processed_/a/3/csm_Mimi_Barks-WOA25-Ankuenderbild_eda11086fa.jpg",uid:1252},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"ministry",title:"Ministry",uid:950},biography:"<p>For one last time Al Jourgesen wants to have another go! One last time Ministry, one last album, and of course, the biggest Metal Festival in the world. Legends among themselves.<br /> Thus W:O:A 2025 is allowed to watch the Grandmaster of Industrial at his profession once again. As soon as Al and Ministry enter the stage, there will be welding and hammering.<br /> As an inspiration for generations of subsequent bands, Ministry started as a Synth Pop Band in the 80s. How time has changed the band’s sound. There is almost a decade between their last W:O:A appearance and their comeback in 2025.<br /> See you soon Al – We are looking forward to see you!&nbsp;</p>",detailLink:"/de/programm/bands/band/ministry/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KfRDCnZ0oJk",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Ministry-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Ministry-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30162}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3548,uri:"https://ministryband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3549,uri:"https://www.facebook.com/WeAreMinistry/"},{socialnetwork:{title:"Instagram",uid:5},uid:3550,uri:"https://www.instagram.com/ministry_collector/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"https://www.youtube.com/watch?v=KfRDCnZ0oJk",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_Ministry-WOA25-Ankuenderbild_91cd17e503.jpg",uid:1267},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"nailbomb",title:"Nailbomb",uid:975},biography:"<p>Yes, you read that right—Nailbomb are coming to bring their Thrash to Wacken! Over 30 years ago, the band was formed by Max Cavalera and Alex Newport, and released just one album, “Point Blank”. Now, in 2025, they are back and on their way to the Holy Ground with even more rage to spread. The new lineup includes Igor Cavalera Jr. (guitar), Travis Stone (guitar), Johny Crow (bass), Alex Cha (sampler), and Adam Jarvis (drums). Be ready!</p>",detailLink:"/de/programm/bands/band/nailbomb/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nailbomb_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nailbomb_25.jpg",title:"",type:2,uid:32221}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3671,uri:"https://www.instagram.com/nailbomb_band_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Q6EFOghPrRjdwsF4p7Nzm",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_nailbomb_25_52a22f7eb7.jpg",uid:1310},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"night-demon",title:"Night Demon",uid:951},biography:"<p>For more than a decade, Night Demon have defiantly waved the flag of traditional Heavy Metal. Unwavering in the face of shifting industry trends and unscarred by global calamities.<br /> Jarvis Leatherby and his Night Demon bandmates nowadays stand for a true Heavy Metal spirit – a group known for their infectious live-shows. They will honor us with a special set for their 10-year Anniversary of „Curse of the Damned“.&nbsp;</p>",detailLink:"/de/programm/bands/band/night-demon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KP-04wAWof0&list=PLa1znBpqOHzLT0aP01zxqmVWR78KavHQa",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Night_Demon-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Night_Demon-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30163}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3551,uri:"https://www.facebook.com/nightdemonband/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3552,uri:"https://www.instagram.com/nightdemonmetal/?hl=de"},{socialnetwork:{title:"Homepage",uid:8},uid:3553,uri:"https://nightdemon.net/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5klvF93hycKWPsqssBXY9A",subtitle:'"Curse of the Dammned" 10th Anniversary Show',thumbnail:"/fileadmin/_processed_/3/9/csm_Night_Demon-WOA25-Ankuenderbild_39336183e3.jpg",uid:1268},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"obituary",title:"Obituary",uid:959},biography:"<p>Slowly We Rot? The band’s classic song might be named that way, but the American steamroller is yet far away from rotting.<br /> The iconic Tardy brothers visit Wacken to bring their Old-School take on Death-Metal. It could also be called a high-quality neck-breaker</p>",detailLink:"/de/programm/bands/band/obituary/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=H-4r3ZjRhts",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"obituary_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/obituary_25.jpg",title:"",type:2,uid:30717}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3574,uri:"Slowly We Rot? The band’s classic song might be named that way, but the American steamroller is yet far away from rotting. The iconic Tardy brothers visit Wacken to bring their Old-School take on Death-Metal. It could also be called a high-quality neck-br"},{socialnetwork:{title:"Facebook",uid:1},uid:3575,uri:"https://www.facebook.com/ObituaryBand/"},{socialnetwork:{title:"Instagram",uid:5},uid:3576,uri:"https://www.instagram.com/obituaryband/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0SbGI4sb8dAKFZnK7RFyhz",subtitle:"",thumbnail:"/fileadmin/_processed_/2/c/csm_obituary_25_787171a7c7.jpg",uid:1277},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"orange-goblin",title:"Orange Goblin",uid:952},biography:"<p><em>“You either are Heavy Metal or you’re not!”</em> – Ben Ward, one of the founding fathers of Stoner Rock and Orange Goblin frontman, gets straight to the point.<br /> We couldn’t agree more, and that’s why we will let our eardrums thoroughly get blasted at Wacken Open Air 2025. Therefore, there is no better way than the stony, no-bullshit sounds of these Brits in the universe of heavy music.<br /> Exactly the taste we enjoy!</p>",detailLink:"/de/programm/bands/band/orange-goblin/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=0zfO6QQTlpk&list=OLAK5uy_m45SJD16phxX3R9zp2HUbsVZb1yrDumIQ&index=1",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Orange_Goblin-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Orange_Goblin-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30164}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3554,uri:"https://www.orangegoblinofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3555,uri:"https://www.facebook.com/orangegoblinofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3556,uri:"https://www.instagram.com/orangegoblinofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3nutnJ57QnbWEdCWn2EyWo",subtitle:"30th Anniversary Show",thumbnail:"/fileadmin/_processed_/0/0/csm_Orange_Goblin-WOA25-Ankuenderbild_a33f1941f8.jpg",uid:1269},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"papa-roach",title:"Papa Roach",uid:963},biography:`<p>Papa Roach, the iconic American Rock band, is set to ignite the stage at Wacken Open Air 2025!&nbsp;Formed in 1993, they've delivered explosive energy and raw emotion through hits like "Last Resort," "Scars," and "Help." With over two decades of relentless touring and numerous platinum albums, their powerful blend of Nu-Metal, Hard Rock, and Alternative continues to captivate fans worldwide. Frontman Jacoby Shaddix's dynamic presence and the band's electrifying performances promise an unforgettable experience at W:O:A. Get ready for a high-octane show that embodies the spirit of rock and resilience.</p>`,detailLink:"/de/programm/bands/band/papa-roach/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=z2zMwYf1bZ4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Papa_Roach-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Papa_Roach-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30213}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3586,uri:"https://paparoachmerch.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3587,uri:"https://www.facebook.com/paparoach/"},{socialnetwork:{title:"Instagram",uid:5},uid:3588,uri:"https://www.instagram.com/paparoach/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4RddZ3iHvSpGV4dvATac9X",subtitle:"",thumbnail:"/fileadmin/_processed_/5/d/csm_Papa_Roach-WOA25-Ankuenderbild_9c2289c085.jpg",uid:1281},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"party-cannon",title:"Party Cannon",uid:982},biography:'<p class="docData;DOCY;v5;2486;">Deathgrind has never been more colorful! Party Cannon brings you a hefty dose of Death Metal and Gore - always with a touch of humor. How else could a brightly colored band logo fit with such extreme brutality? Let’s fire up this cannon! But, put on your knee pads first, because - as the Scots titled their latest album - <em>Injuries Are Inevitable.</em></p>',detailLink:"/de/programm/bands/band/party-cannon/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/ZEv9EM4wPJg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"party_cannon25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/party_cannon25.jpg",title:"",type:2,uid:32578}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3697,uri:"https://party-cannon.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3698,uri:"https://www.facebook.com/PartyCannonUK"},{socialnetwork:{title:"Instagram",uid:5},uid:3699,uri:"https://www.instagram.com/party_cannon_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5Oz5WX5xkESHBH5I4Wp09C",subtitle:"",thumbnail:"/fileadmin/_processed_/0/4/csm_party_cannon25_a495f904a3.jpg",uid:1320},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"peyton-parrish",title:"Peyton Parrish",uid:659},biography:"<p>The Vikings are on the loose! And Peyton Parrish is their leader. The extraordinary vocalist has already made a name for himself with contributions to the Vikings Soundtrack and several chart hits.<br /> The effortless switching between different genres of heavy music does make the American a gigantic phenomenon. He masters both the hardest and softest of sounds.<br /> After getting a taste in 2023, he returns this year and that with a band. Get your drinking horns ready!&nbsp;&nbsp;&nbsp;</p>",detailLink:"/de/programm/bands/band/peyton-parrish/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=cBNVQ4HsMag",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Peyton_Parrish-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Peyton_Parrish-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30238}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3608,uri:"https://www.facebook.com/ParrishFans/"},{socialnetwork:{title:"Instagram",uid:5},uid:3609,uri:"https://www.instagram.com/peytonparrishmusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"62uiaKAdkbY94iXJnXyKzc",subtitle:"",thumbnail:"/fileadmin/_processed_/8/1/csm_Peyton_Parrish-WOA25-Ankuenderbild_f0a06e9ecf.jpg",uid:1290},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"prong",title:"Prong",uid:99},biography:'<p>Since the mid-80s, PRONG have been an indispensable force in the Metal universe and inspired icons like Nine Inch Nails and Korn. The American Groove Metal masters, led by guitarist and vocalist Tommy Victor, keep the Punk spirit alive and deliver with their latest album<em>, </em>"State of Emergency"<em>,</em> a hard-hitting soundtrack pushing against the tide of time. Live in Wacken, once more!</p>',detailLink:"/de/programm/bands/band/prong/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_yzSFc2kzr4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"prong25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/prong25.jpg",title:"",type:2,uid:32222}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3672,uri:"https://prongmusic.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3673,uri:"https://www.facebook.com/prongmusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3674,uri:"https://www.instagram.com/prongtheband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6SER9tY2pDIDVWVf5Ql97B",subtitle:"",thumbnail:"/fileadmin/_processed_/4/1/csm_prong25_54af7e1b06.jpg",uid:1311},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"rauhbein",title:"Rauhbein",uid:496},biography:"<p>With honest lyrics, a rough voice, and catchy Folk Rock, Rauhbein have been entertaining their fans since 2019. Their love for boisterous songs like “Fass voller Whiskey” or “Hoch die Tassen” is no coincidence. Because band leader Henry M. Rauhbein had his best and most direct experiences as a pub musician during his time in Ireland. We want to celebrate this dedication to drinking, swaying and happiness with you at W:O:A 2025.</p>",detailLink:"/de/programm/bands/band/rauhbein/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=bLLo6WlXzio",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"rauhbein25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/rauhbein25.jpg",title:"",type:2,uid:32223}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3675,uri:"https://rauhbein.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3676,uri:"https://www.facebook.com/people/Rauhbein/100064058886424/"},{socialnetwork:{title:"Instagram",uid:5},uid:3677,uri:"https://www.instagram.com/rauhbein_offiziell/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0neCOkQjYXJMLW7cvOw6fe",subtitle:"",thumbnail:"/fileadmin/_processed_/c/1/csm_rauhbein25_af935e47d2.jpg",uid:1312},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"saltatio-mortis",title:"Saltatio Mortis",uid:319},biography:"<p>Old love never rusts! The in 2000 in Germany founded band started out as street musicians. After dedicating their lives to medieval rock music, they have been touring Metal-, Rock-, and medieval festivals all over Germany.<br /> Since then the friendship between Saltatio Mortis and the W:O:A only grew. In the meantime, it’s love. With their strong and new record “Finsterwacht”, the Karlsruhe based band once again proved their reputation.<br /> For their 2025 return to the Holy Ground, they are throwing a huge party for their 25<sup>th</sup> Anniversary.</p>",detailLink:"/de/programm/bands/band/saltatio-mortis/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=2Cb0Q9lIRMU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Saltatio_Mortis-WOA25-Ankuenderbild6.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Saltatio_Mortis-WOA25-Ankuenderbild6.jpg",title:"",type:2,uid:30231}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3597,uri:"https://www.saltatio-mortis.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3598,uri:"https://www.facebook.com/saltatiomortisofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3599,uri:"https://www.instagram.com/saltatiomortis/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"09Z51O0q4AwHl7FjUUlFKw",subtitle:"25th Anniversary Show",thumbnail:"/fileadmin/_processed_/c/5/csm_Saltatio_Mortis-WOA25-Ankuenderbild6_da88adf5f3.jpg",uid:1285},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"saxon",title:"Saxon",uid:175},biography:`<p>Saxon, the legendary British Heavy Metal band, is set to rock the Wacken Open Air 2025! Formed in 1977, Saxon has been a driving force in the New Wave of British Heavy Metal, influencing countless bands with their powerful sound and electrifying performances.<br /> Known for iconic hits like "Wheels of Steel" and "Denim and Leather," they have released over 20 studio albums and toured the globe extensively. Saxon's high-energy shows and dedication to true Metal have earned them a loyal fan base and critical acclaim.<br /> Don’t miss their next stop at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/saxon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=SWNJWPUKXaQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Saxon-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Saxon-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30230}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3595,uri:"https://saxon747.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3596,uri:"https://www.facebook.com/saxon/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"71vVmHeNgCVSa5SVmfvscU",subtitle:"",thumbnail:"/fileadmin/_processed_/9/5/csm_Saxon-WOA25-Ankuenderbild_ba75dff4f1.jpg",uid:1284},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"schandmaul",title:"Schandmaul",uid:560},biography:"<p>They sing of true heroes, rogues, and scoundrels, pay homage to the king of fools and have been telling tales from the otherworld for over a quarter of a century. Schandmaul are currently celebrating their anniversary with everything that goes with it: folky joy, songs from #1 and gold-certified albums and plenty of surprises. The cat is out of the bag: the Bavarian medieval rockers are gracing us with their spirited birthday show two years after their originally planned W:O:A performance!</p>",detailLink:"/de/programm/bands/band/schandmaul/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=DkXYei3r97E",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"schandmaul_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/schandmaul_25.jpg",title:"",type:2,uid:32579}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3700,uri:"https://www.schandmaul.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3701,uri:"https://www.facebook.com/Schandmaul"},{socialnetwork:{title:"Instagram",uid:5},uid:3702,uri:"https://www.instagram.com/schandmaulband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"388Jc5WX2TxTOgGwXidDM7",subtitle:"",thumbnail:"/fileadmin/_processed_/c/5/csm_schandmaul_25_3ac58d193a.jpg",uid:1321},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"seven-spires",title:"Seven Spires",uid:953},biography:"<p>A genre fluid band, consisting of best friends, who was founded at the Berkley College? Seven Spires tick all these boxes and have a lot more to give!<br /> The Extreme Metal group that loves to go for a deep dive into jazz was able to win over North-America, Europe as well as Asia.<br /> Right now, Wacken is calling!</p>",detailLink:"/de/programm/bands/band/seven-spires/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=k6qcBWGRgIg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Seven_Spires-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Seven_Spires-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30165}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3557,uri:"https://www.sevenspiresband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3558,uri:"https://www.facebook.com/sevenspiresband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3559,uri:"https://www.instagram.com/sevenspiresband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2lP1T5oI2BjkLq9axMhG2o",subtitle:"",thumbnail:"/fileadmin/_processed_/1/8/csm_Seven_Spires-WOA25-Ankuenderbild_96ea94c222.jpg",uid:1270},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"svarttjern",title:"Svarttjern",uid:969},biography:'<p class="docData;DOCY;v5;2592;">In Norwegian, the word stands for black tarn. It’s no coincidence that the painting of the same name by Norwegian artist August Cappelen evokes the same oppressive and bleak mood as the pitch-dark&nbsp;Black Metal of Svarttjern. You don’t believe us? Just take a closer look at the painting yourself and listen to the sounds of the five&nbsp;piece on the Holy Ground afterwards!</p>',detailLink:"/de/programm/bands/band/svarttjern/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=t1buXo_eTPs",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"svartjern_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/svartjern_25.jpg",title:"",type:2,uid:30718}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3634,uri:"https://www.facebook.com/svarttjern/"},{socialnetwork:{title:"Instagram",uid:5},uid:3635,uri:"https://www.instagram.com/svarttjernofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"34HkAxbpa90Btjkv8RA0wh",subtitle:"",thumbnail:"/fileadmin/_processed_/0/e/csm_svartjern_25_4424127695.jpg",uid:1299},{artist:{country:[],events:[],pathSegment:"tarja-marko-hietela",title:"Tarja & Marko Hietela",uid:964},biography:`<p>Tarja Turunen – a whole generation of Metalheads is getting attentive when this name comes up. She was the start into the heavy parallel-universe for many; moreover, she wrote Metal history with Nightwish at the time.</p>\r
<p>After a series of successful performances in South America, where Marko Hietala supported Tarja as a special guest for several shows, the dynamic duo is to return to captivate European audiences with their enthralling collaboration.<br /> The show at Wacken, of the two ex-members of Nightwish, in 2025 promises to be an unforgettable experience as these two Wacken-familiar voices reunite on stage once again</p>`,detailLink:"/de/programm/bands/band/tarja-marko-hietela/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=6I75X2-qU8k",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Tarja_and_Marko_Hietala-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Tarja_and_Marko_Hietala-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30239}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3610,uri:"https://www.facebook.com/tarjaofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3611,uri:"https://www.instagram.com/tarjaofficial/"},{socialnetwork:{title:"Homepage",uid:8},uid:3612,uri:"https://tarjaturunen.com"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5IRFMGI8aEtZdN07OYrBZc",subtitle:"",thumbnail:"/fileadmin/_processed_/1/4/csm_Tarja_and_Marko_Hietala-WOA25-Ankuenderbild_9718f63083.jpg",uid:1291},{artist:{country:[{nameLocalized:"Costa Rica",shortNameDe:"Costa Rica",shortNameEn:"Costa Rica",uid:48}],events:[],pathSegment:"umbra-conscientia",title:"Umbra Conscientia",uid:954},biography:'<p class="docData;DOCY;v5;2780;">It’s not an easy task to investigate who lit up who. But one thing is for sure: The tender flame of Black Metal blazes steadily in the co-production Umbra Conscienta. Somewhere between the speedy guitar attacks and floating, doomy parts, the Umbra Conscientia&nbsp;(which means shadow of sonsciousness) found their home in 2018 and are sweetly torturing our minds since then. The Costa&nbsp;Rican and German union will prove its firepower&nbsp;at&nbsp; W:O:A 2025.</p>',detailLink:"/de/programm/bands/band/umbra-conscientia/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Umbra_Conscientia-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Umbra_Conscientia-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30166}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3560,uri:"https://www.facebook.com/UmbraConscientia/"},{socialnetwork:{title:"Instagram",uid:5},uid:3561,uri:"https://www.instagram.com/umbra_conscientia/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3VQSd6slqOJCxmtpiW5Icl",subtitle:"",thumbnail:"/fileadmin/_processed_/4/b/csm_Umbra_Conscientia-WOA25-Ankuenderbild_d7cbefeefa.jpg",uid:1272},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"victory",title:"Victory",uid:911},biography:'<p class="docData;DOCY;v5;2422;">What Los Angeles and the Sunset Strip are to the US, Hanover is to Germany—albeit on a smaller scale. Eloy, Jane, Fury in the Slaughterhouse, the Scorpions, and of course, Victory. The Hard Rock veterans still know how to ignite a crowd even after decades in business. Don’t believe us? Then see for yourselves and turn the Holy Ground into a Victory fireworks with the band. With rockets like you and a scorching hot band, we are certain nothing will go wrong, right?&nbsp;</p>',detailLink:"/de/programm/bands/band/victory/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=D6HGy_OaC0A",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"victory25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/victory25.jpg",title:"",type:2,uid:32574}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3687,uri:"https://www.victory-band.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3688,uri:"https://www.facebook.com/victorybandofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3689,uri:"https://www.instagram.com/victorybandofficially/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"71rNgVUS9VQlZoctS9pOe1",subtitle:"",thumbnail:"/fileadmin/_processed_/c/0/csm_victory25_573853e8a0.jpg",uid:1316},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"walls-of-jericho",title:"Walls of Jericho",uid:980},biography:"<p>For seven days, Joshua and his men were to march around the city of Jericho, breaking into an infernal war&nbsp;cry on the final day to bring the city’s walls crashing down. What sounds like the usual Wacken moshpit is actually the biblical story behind the name of the Hardcore band from Detroit, founded in 1998. Frontwoman Candace Kucsulain and her crew have proven time and time again that their aggressive Hardcore Punk is more than capable of tearing down walls. They’ll prove it once more with another electrifying show at W:O:A 2025. Get your dust boots ready—the pit is calling!</p>",detailLink:"/de/programm/bands/band/walls-of-jericho/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=VuQR2dAFD3c",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"walls_of_jericho25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/walls_of_jericho25.jpg",title:"",type:2,uid:32576}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3693,uri:"https://www.facebook.com/WallsofJericho/"},{socialnetwork:{title:"Instagram",uid:5},uid:3694,uri:"https://www.instagram.com/wojofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"60cGRl68qyCBMqZi3tiHEU",subtitle:"",thumbnail:"/fileadmin/_processed_/4/2/csm_walls_of_jericho25_8c507edeee.jpg",uid:1318},{artist:{country:[{nameLocalized:"Italien",shortNameDe:"Italien",shortNameEn:"Italy",uid:104}],events:[],pathSegment:"windrose",title:"Wind Rose",uid:966},biography:'<p>With their cover-version of the Minecraft-Song “Diggy Diggy Hole”, the Italian Power Metal band Wind Rose landed a gigantic hit. Not only Minecraft but also Tolkien is a big influence on the group. The realm of the dwarves captivated them so intensely that they dedicated their whole artistic direction towards them. With their 2024 release "Trollslayer", Wind Rose return to Wacken to take the Holy Ground like a storm. If their full dwarves-power is able to dig their way to the stage?</p>',detailLink:"/de/programm/bands/band/windrose/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=8ZXBm1NXBaI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"windrose_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/windrose_25.jpg",title:"",type:2,uid:30313}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3622,uri:"https://www.facebook.com/windroseofficial/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3623,uri:"https://www.instagram.com/windroseofficial/?hl=de"},{socialnetwork:{title:"Homepage",uid:8},uid:3624,uri:"https://www.windroseofficial.com"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"67ps5pbKVO7V9Fcb4lTIXz",subtitle:"",thumbnail:"/fileadmin/_processed_/4/8/csm_windrose_25_ba8346e2fe.jpg",uid:1295},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"within-temptation",title:"Within Temptation",uid:23},biography:'<p class="docData;DOCY;v5;4286;">Founded back in 1996 by&nbsp;singer and fashion&nbsp;designer Sharon Den Adel and her partner Robert Westerholt, the&nbsp;successful&nbsp;Dutch sextet WITHIN TEMPTATION can&nbsp;proudly&nbsp;look back on huge, sold out shows all around&nbsp;the&nbsp;world, numerous&nbsp;gold and platin&nbsp;awards&nbsp;for #1 records in their&nbsp;home&nbsp;country&nbsp;as&nbsp;well&nbsp;as in Germany. And so we&nbsp;are happy to&nbsp;have&nbsp;the&nbsp;spear&nbsp;head&nbsp;of&nbsp;symphonic Alternative Metal on the Holy Ground for&nbsp;the&nbsp;fifth time, rocking&nbsp;their&nbsp;latest&nbsp;album „Bleed Out“&nbsp;with&nbsp;you. Let‘s&nbsp;cheer&nbsp;together&nbsp;loud and proud „Van harte welkom“!</p>',detailLink:"/de/programm/bands/band/within-temptation/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=tEqJhULw_9c&t=3s",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Within_Temptation-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Within_Temptation-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30241}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3616,uri:"https://www.within-temptation.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3617,uri:"https://www.facebook.com/wtofficial"},{socialnetwork:null,uid:3618,uri:"https://www.instagram.com/wtofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3hE8S8ohRErocpkY7uJW4a",subtitle:"",thumbnail:"/fileadmin/_processed_/e/8/csm_Within_Temptation-WOA25-Ankuenderbild_dd8a3c5c9f.jpg",uid:1293}];export{A as default};
